import Button, { Box, Container, TextField } from '@mui/material';
import './App.css';

const keys = [
    { text: '9', value: 9 },
    { text: '8', value: 8 },
    { text: '7', value: 7 },
    { text: '6', value: 6 },
    { text: '5', value: 5 },
    { text: '4', value: 4 },
    { text: '3', value: 3 },
    { text: '2', value: 2 },
    { text: '1', value: 1 },
    { text: '0', value: 0 },
    { text: 'Отправить', value: 'send' },
];

function App() {
  return (
    <Container maxWidth={`500px`}>
        <TextField id="summ" label="Сумма к снятию" variant="filled" />
        <Box component="section" sx={{ p: 2 }}>
            {keys.map(item =>(
                <Button variant="outlined" key={item.value}>{item.value}</Button>
            ))}
        </Box>
    </Container>
  );
}

export default App;
